from typing import *
from itertools import groupby
def removeDuplicates(s: str, k: int) -> str:
    while True:
        res = []
        for c, g in groupby(s):
            res.append(c * (len(list(g)) % k))
        if len(''.join(res)) == len(s):
            return s
        s = ''.join(res)
