# 215. Kth Largest Element in an Array
def findKthLargest(nums, k) -> int:
    def parition(l, r) -> int:
        wall = l
        pivot = nums[r]
        for i in range(l, r):
            if nums[i] < pivot:
                nums[wall], nums[i] = nums[i], nums[wall]
                wall += 1
        nums[r], nums[wall] = nums[wall], nums[r]
        return wall

    n = len(nums)
    l, r = 0, n - 1
    while True:
        pos = parition(l, r)
        if pos > n - k:
            r = pos - 1
        elif pos < n - k:
            l = pos + 1
        else:
            return nums[pos]

