def aboveAverageSubarrays(A: List[int]) -> List[List[int]]:
  prefix = [0]
  result = []
  for i in A:
    prefix.append(prefix[-1] + i)  # [0, 3, 7, 9]
  for i in range(len(A) + 1):
    for j in range(i+1, len(A) + 1):
      subarray_sum = prefix[j] - prefix[i]  # subarry sum: A subarray(i:j-1) inclusive
      remain_sum = prefix[-1] - subarray_sum
      subarray_avg = subarray_sum / (j - i)
      remain_avg = 0 if (len(A) - (j-i))==0 else remain_sum / (len(A) - (j-i))
      if remain_avg < subarray_avg:
        result.append([i+1, j])
  return result

print(aboveAverageSubarrays([3,4,2]))
